      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E{\"@context\":\"https:\/\/schema.org\",\"@type\":\"FAQPage\",\"mainEntity\":[{\"@type\":\"Question\",\"name\":\"Is RapidAPI Free?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"RapidAPI has three types of APIs: free, freemium, and paid.\\n\u003Ctable class=\\\"tg\\\"\u003E\\n  \u003Ctbody\u003E\u003Ctr\u003E\\n    \u003Cth class=\\\"tg-0lax\\\"\u003EFree APIs\u003C\/th\u003E\\n    \u003Cth class=\\\"tg-0lax\\\"\u003EAPIs that do not require a credit card or subscription plan to consume\u003C\/th\u003E\\n  \u003C\/tr\u003E\\n  \u003Ctr\u003E\\n    \u003Ctd class=\\\"tg-0lax\\\"\u003EFreemium APIs\u003C\/td\u003E\\n    \u003Ctd class=\\\"tg-0lax\\\"\u003EPaid APIs that include a limited free tier and require a credit card\u003C\/td\u003E\\n  \u003C\/tr\u003E\\n  \u003Ctr\u003E\\n    \u003Ctd class=\\\"tg-0lax\\\"\u003EPaid APIs\u003C\/td\u003E\\n    \u003Ctd class=\\\"tg-0lax\\\"\u003EAPIs that require a paid subscription plan and credit card to consume\u003C\/td\u003E\\n  \u003C\/tr\u003E\\n\u003C\/tbody\u003E\u003C\/table\u003E\"}},{\"@type\":\"Question\",\"name\":\"What are cool APIs?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Cool APIs are exciting APIs that are fun and unique. Browse the selection we have in this collection to see what you can integrate into your app.\"}},{\"@type\":\"Question\",\"name\":\"What are Free APIs?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003EFree APIs are \u003Ca href=\\\"https:\/\/rapidapi.com\/blog\/api-glossary\/api\/\\\"\u003EAPIs \u003C\/a\u003E that require no payment to use. Only RapidAPI, there are 2 tiers of free APIs:\u003C\/p\u003E\\n\u003Col\u003E\\n\u003Cli\u003EFree APIs\u003C\/li\u003E\\n\u003Cli\u003EFreemium APIs\u003C\/li\u003E\\n\u003C\/ol\u003E\\n\u003Ctable class=\\\"tg\\\"\u003E\\n  \u003Ctbody\u003E\u003Ctr\u003E\\n    \u003Cth class=\\\"tg-0lax\\\"\u003EFree APIs\u003C\/th\u003E\\n    \u003Cth class=\\\"tg-0lax\\\"\u003EAPIs that do not require a credit card or subscription plan to consume\u003C\/th\u003E\\n  \u003C\/tr\u003E\\n  \u003Ctr\u003E\\n    \u003Ctd class=\\\"tg-0lax\\\"\u003EFreemium APIs\u003C\/td\u003E\\n    \u003Ctd class=\\\"tg-0lax\\\"\u003EPaid APIs that include a limited free tier and require a credit card\u003C\/td\u003E\\n  \u003C\/tr\u003E\\n\u003C\/tbody\u003E\u003C\/table\u003E\"}},{\"@type\":\"Question\",\"name\":\"What is RapidAPI?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"RapidAPI is an API Marketplace for developers to find, connect, and manage their API connections. … If you have an API you've created, use RapidAPI to make it available to hundreds of thousands of developers already utilizing APIs through RapidAPI.\"}},{\"@type\":\"Question\",\"name\":\"What is a Public API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003EAn open API (often referred to as a public API) is a publicly available application programming interface that provides developers with programmatic access to a proprietary software application or web service. APIs are sets of requirements that govern how one application can communicate and interact with another. - \u003Ca href=\\\"https:\/\/en.wikipedia.org\/wiki\/Open_API\\\"\u003EWikipedia\u003C\/a\u003E\u003C\/p\u003E\"}}]}\u003C\/script\u003E",
