      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E{\"@context\":\"https:\/\/schema.org\",\"@type\":\"FAQPage\",\"mainEntity\":[{\"@type\":\"Question\",\"name\":\"Why has Ticketmaster decided to open up its API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"At Ticketmaster, we see ourselves as the engine that powers unforgetable moments of joy for fans everywhere. That’s our purpose. That’s our promise. We also believe strongly that innovation is fostered best through openness and transparency. Therefore, we’re opening up our data because we want to give you, the developer, the ability to explore its potential beyond what we have already done. We want you to bring those moments of joy to fans through compelling and innovative products powered by our APIs.\"}},{\"@type\":\"Question\",\"name\":\"How can I reach out to Ticketmaster to discuss a potential partnership opportunity?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Exciting! Please contact us and try to be as specific as you can so we can bring in the right people to have a follow-up discussion regarding this potential opportunity. We should get back to you by email within 48 hours.\"}},{\"@type\":\"Question\",\"name\":\"How might I use the content that’s made available via the Ticketmaster API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"We want you to be as creative and as innovative as possible with our data. We have tried hard to put as little constraints on you as possible. The only thing we ask you to do is to comply with our Terms of Use.\"}},{\"@type\":\"Question\",\"name\":\"What is the default quota for API requests?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"The default access all applications get is to our Public APIs with a quota of 2 requests\/sec and 5000 req\/day.\"}},{\"@type\":\"Question\",\"name\":\"What datasets does the API cover?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"The Ticketmaster API offers access to live events, attractions, venues and tickets! The datasets span all North American and International markets. Furthermore, the Ticketmaster API provides data coming from ticketing platforms like TicketWeb, Universe and Front Gate.\"}},{\"@type\":\"Question\",\"name\":\"What data formats does the Ticketmaster API support?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"The Ticketmaster API supports the JSON format only at this time.\"}},{\"@type\":\"Question\",\"name\":\"Why should I join the Ticketmaster Affiliate Program?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"With more than 150K events ticketed each year, Ticketmaster offers unparalleled access to live sports, concerts, theater productions and family events.\\n\\nIf you are looking to build or enhance a user experience in the live event space, Ticketmaster’s superior content depth and technology solutions means greater choice for your users, as well as opportunity to monetize. Not to mention the Ticketmaster brand and our Verified Tickets promise makes us the most trusted, respected brand in live event ticketing. Our affiliate program plays a crucial part of Ticketmaster’s business strategy in finding new audiences for our clients, from industry leaders to small start-ups.\"}},{\"@type\":\"Question\",\"name\":\"Speaking of monetization, how do I earn money through the affiliate program?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"The program compensates partners based on sales delivered (not traffic sent), both in primary and resale channels. Specific rates and terms can be discussed during the onboarding process, but Ticketmaster does not pay commission on primary tickets during the first 24 hours following a public onsale. The Ticketmaster cookie is valid for 30 days, and the TicketsNow cookie is valid for 60 days.\"}},{\"@type\":\"Question\",\"name\":\"Is the Ticketmaster affiliate program right for me?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"The affiliate program is best-suited for websites and apps that can deliver unique buyers to Ticketmaster’s clients, who are looking to drive incremental sales beyond what takes place on Ticketmaster or client websites. If you think you fit the mold, please reach out to distributedcommerce@ticketmaster.com.\"}},{\"@type\":\"Question\",\"name\":\"How does the onboarding process work?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Ticketmaster will provide appropriate publishers an API key, or other content tools, to access the Discovery API. You will also need to separately create a publisher account through Impact Radius, our third-party provider who manages our tracking, reporting and payments.\\n\\nOnce you have an affiliate publisher ID, you will wrap destination URLs in an Impact Radius wrapper to ensure proper tracking, so that when you deliver a sale to Ticketmaster or Ticketsnow, you’ll be credited for the purchase. You will be able to receive reporting through the Impact Radius interface, as well as custom reports that can be sent on a daily basis.\\n\\nBefore signing up at Impact Radius, please reach out to us about whether you’re appropriate for the program!\"}},{\"@type\":\"Question\",\"name\":\"What content and tools will be available to me?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Our Discovery API will provide access to events for sale on Ticketmaster.com and Ticketweb. We can also grant access to our resale API which has all events from our secondary market suite of sites including NFL Ticket Exchange, NHL Ticket Exchange, NBA Tickets Resale Marketplace, and TicketsNow.com, which can also be listed and monetized. Talk to your account manager if you are interested.\"}},{\"@type\":\"Question\",\"name\":\"Can my users transact on tickets through my site?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Later this year, you will be able to leverage our purchase widget to sell tickets without users ever leaving your site. Talk to your account manager about timing and opportunities!\"}},{\"@type\":\"Question\",\"name\":\"But I’d like to actually sell tickets in my own shopping cart. Can I do that?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"In most cases, no. Our program largely serves affiliates who can create unique content experiences that complement our clients’ aims and drive incremental traffic to Ticketmaster.com for conversion. Ticketmaster will grant access to our Partner Commerce API for a limited number of partners. Please contact distributedcommerce@ticketmaster.com if you have any questions.\"}},{\"@type\":\"Question\",\"name\":\"What markets does the Ticketmaster serve?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"This program specifically serves the North American market (US \u0026 CA). We do have an international program that you can join that serves markets across Europe and beyond. (UK, IE, SE, ES, DE, AT, NL, BE, FR, AU, NZ).\"}},{\"@type\":\"Question\",\"name\":\"Will I have access to official artist\/team creative?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Our content solutions provide high-res images for Ticketmaster.com events, along with all necessary event meta data. You do not have the right to leverage official team and league creative from the various sports leagues (NFL, NBA, MLB, NHL) by default, but we may in some cases route specific requests to the league through your account manager.\"}}]}\u003C\/script\u003E",
