      "metadata":["map"],
      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E{\"@context\":\"https:\/\/schema.org\",\"@type\":\"FAQPage\",\"mainEntity\":[{\"@type\":\"Question\",\"name\":\"Can we retrieve and store Zillow data?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No. You may use the API only to retrieve and display dynamic content from Zillow. You are not permitted to store information locally.\"}},{\"@type\":\"Question\",\"name\":\"Instead of using the API, can we reverse engineer a data feed or manually pull information from Zillow?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No. We permit third parties to retrieve data from our site only through the API. Any reverse engineering, spiders, or other techniques used to directly pull data without using the Zillow API is a violation of our Terms of Use.\"}},{\"@type\":\"Question\",\"name\":\"How do I get maps and Bird's Eye View images?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Zillow does not currently provide maps in its API call results. You will need to use your own mapping technology. See Yahoo!, Microsoft, or Google for map APIs you can use.\"}},{\"@type\":\"Question\",\"name\":\"What happens when my site hits 1,000 calls in a day?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Your API calls will be blocked until Zillow can review your site to confirm that it adheres to our Terms of Use. Please reach out to huann@zillow.com for more info.\"}},{\"@type\":\"Question\",\"name\":\"How many API calls can I have on the same page?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"You can run up to 20 API calls on one page at one time.\"}},{\"@type\":\"Question\",\"name\":\"Does Zillow provide sample scripts for the coding necessary to pull the API data?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"At this time, Zillow provides sample API calls, but does not provide the sample scripts for pulling data from the call results. These scripts will depend upon the language you are using and your specific output preferences.\"}},{\"@type\":\"Question\",\"name\":\"Does Zillow provide a developer kit for other languages (Java, Perl, etc.)?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Zillow is working to create additional developer documentation, but currently provides a guide for XML only. \"}},{\"@type\":\"Question\",\"name\":\"Can I share my API application with others?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"You may share your application. However, you may not share your ZWSID.\"}},{\"@type\":\"Question\",\"name\":\"Can we build an API application for a back-end function that has no end-user interface?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No. Zillow requires links back to Zillow as outlined in our documentation. A back-end function cannot meet this requirement.\"}},{\"@type\":\"Question\",\"name\":\"Can we build an API application that has no links back to Zillow?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No. Zillow requires links back to Zillow as outlined in our documentation.\"}},{\"@type\":\"Question\",\"name\":\"What happens if the search can't find the home?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"The API will either return other home addresses that closely resemble the searched address or will not return any value if no match is found.\"}},{\"@type\":\"Question\",\"name\":\"What happens if Zillow changes the API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Zillow reserves the right to change the API code at any time.\\n\"}},{\"@type\":\"Question\",\"name\":\"Can I filter the reviews?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No, the API always returns the most recent reviews from newest to oldest and those are the ones you should show.\"}},{\"@type\":\"Question\",\"name\":\"Will you only show the first few and require a link over to see all? \",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Please contact reviewsapi@zillow.com if you want to display the full set of reviews or have other implementation questions.\"}},{\"@type\":\"Question\",\"name\":\"Can we change the start colors to match our site's brand?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No, you need to follow Zillow's branding requirements.\"}},{\"@type\":\"Question\",\"name\":\"I lost my ZWSID. How can I get it again?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Go to the API Home Page and click on the \\\"Forgot my ZWSID\\\" link.\"}},{\"@type\":\"Question\",\"name\":\"Can I sign up for only the Property Details API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No. You may sign up for only the Home Valuation API or both APIs. However, you are not required to use both on your site.\"}},{\"@type\":\"Question\",\"name\":\"Will Zillow sign an NDA (Non-Disclosure Agreement) to discuss a possible partnership, or can I explore other partnership opportunities with Zillow?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Zillow does not have the resources necessary to discuss more involved partnerships with API Network Members at this time. While you are welcome to contact us with a proposal, it is unlikely that we will be able to pursue further partnership opportunities.\"}},{\"@type\":\"Question\",\"name\":\"Will there be more APIs?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Zillow plans to continue to provide innovative APIs in the future in order to improve your Web site user experience. Please check our Web site regularly for more information.\"}},{\"@type\":\"Question\",\"name\":\"Will Zillow be charging me in the future to use the API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No. Zillow has no intention of charging any party for any use of the API.\"}},{\"@type\":\"Question\",\"name\":\"The terms say that I cannot send out a press release without Zillow approval. Can I post to a blog without Zillow approval?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Yes. You may post to a blog to publicize your launch.\"}},{\"@type\":\"Question\",\"name\":\"Can I market or advertise, either on or off of my site, the integration of Zillow tools on my site?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Yes. You may market or advertise the Zillow API integration as long as you adhere to our Terms of Use. \"}}]}\u003C\/script\u003E",
