      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\"\u003E{\"@context\":\"https:\/\/schema.org\",\"@type\":\"FAQPage\",\"mainEntity\":[{\"@type\":\"Question\",\"name\":\"Is there a Zillow API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003EYes, the \u003Ca href=\\\"https:\/\/rapidapi.com\/dimashirokov\/api\/Zillow\/details\\\"\u003EZillow API\u003C\/a\u003E is available on RapidAPI and consumable in any programming language. Check out this \u003Ca href=\\\"https:\/\/rapidapi.com\/blog\/zillow-api-python\/\\\"\u003EPython tutorial here\u003C\/a\u003E.\u003C\/p\u003E\"}},{\"@type\":\"Question\",\"name\":\"What is the Netflix API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003E\u003Ca href=\\\"https:\/\/rapidapi.com\/blog\/directory\/netflix\/\\\"\u003ENetflix API\u003C\/a\u003E refers to the API provided by Netflix for developers. As of Nov 14, 2014, the API was deprecated and shut down. Try using the \u003Ca href=\\\"https:\/\/rapidapi.com\/unogs\/api\/unogs\\\"\u003EuNoGS API\u003C\/a\u003E instead, which is available on RapidAPI.\u003C\/p\u003E\"}},{\"@type\":\"Question\",\"name\":\"What is GDS API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003EGDS API Integration. GDS is a worldwide \\\"Global Distribution System\\\" computerized reservation network used as a single point of access for accommodating airline seats, hotel rooms, rental cars, and other travel related items by travel agents, online reservation sites, and large corporations. - \u003Ca href=\\\"http:\/\/www.axissoftech.com\/GDS-Integration.html\\\"\u003ESource\u003C\/a\u003E\u003C\/p\u003E\"}},{\"@type\":\"Question\",\"name\":\"Does TripAdvisor have an API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003EYes, \u003Ca href=\\\"https:\/\/rapidapi.com\/apidojo\/api\/tripadvisor1\\\"\u003ETripAdvisor has an API, which you can access here\u003C\/a\u003E. Per the API's description: These APIs help query real-time flight prices, hotel bookings, restaurants, attractions, and more.\u003C\/p\u003E\"}},{\"@type\":\"Question\",\"name\":\"Does Airbnb have an API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003E\u003Ca href=\\\"https:\/\/rapidapi.com\/blog\/mashvisor-api-airbnb-data\/\\\"\u003EAirbnb does have an API\u003C\/a\u003E, but it is \u003Ca href=\\\"https:\/\/www.quora.com\/Does-Airbnb-have-a-publicly-accessible-programming-API\\\"\u003Enot publicly accessible\u003C\/a\u003E. Try using the \u003Ca href=\\\"https:\/\/rapidapi.com\/mashvisor-team\/api\/mashvisor\\\"\u003EMashvisor Airbnb API\u003C\/a\u003E instead.\u003C\/p\u003E\"}},{\"@type\":\"Question\",\"name\":\"Does Google Flights have an API?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"\u003Cp\u003EYes, but as of \u003Ca href=\\\"https:\/\/rapidapi.com\/blog\/google-flights-api-incorporate-travel-data-into-your-app\/\\\"\u003EApril 10, 2018\u003C\/a\u003E, the \u003Ca href=\\\"https:\/\/rapidapi.com\/collection\/qpx-alternative\\\"\u003EQPX Express API\u003C\/a\u003E has been deprecated. While this API is deprecated, there are still many \u003Ca href=\\\"https:\/\/rapidapi.com\/collection\/flight-data-apis\\\"\u003Eflight APIs\u003C\/a\u003E available including \u003Ca href=\\\"https:\/\/rapidapi.com\/skyscanner\/api\/skyscanner-flight-search\\\"\u003ESkyscanner\u003C\/a\u003E, which is widely accepted as an alternative to the Google Flights API.\u003C\/p\u003E\"}}]}\u003C\/script\u003E",
