      "once_per_event":true,
      "vtp_html":"\u003Cscript type=\"application\/ld+json\" class=\"next-head\"\u003E{\"@context\":\"https:\/\/schema.org\",\"@type\":\"FAQPage\",\"mainEntity\":[{\"@type\":\"Question\",\"name\":\"Are the COVID-19 APIs free?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Almost all COVID-19 APIs providing data on the Coronavirus are free or on a freemium-based model.\"}},{\"@type\":\"Question\",\"name\":\"How to get access to the Coronavirus APIs?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"To start using these APIs, simply sign up for a free RapidAPI user account, navigate to one of these APIs and click \\\"Test API\\\".\"}},{\"@type\":\"Question\",\"name\":\"How to use the COVID-19 APIs?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"There are many applications with these APIs on RapidAPI, take a look at these \u003Ca href=\\\"https:\/\/rapidapi.com\/blog\/developers-respond-to-covid-19\/#tutorials-using-coronaviruscovid-19-apis\\\"\u003Etutorials and apps made using these APIs\u003C\/a\u003E.\"}}]}\u003C\/script\u003E",
